(953, 1029, 'Foi realizado manutencao preventivo no sistema de cloracao do cliente. Encontramos uma bomba centrifuga queimada a mesma foi consertar a. Foi realizado manutenção nas válvulas e injetores.', 2, '0000-00-00 00:00:00'),
