(957, 876, 'OCORRENCIA: instalação.\n CAUSA: nova instalação\n SOLUCAO: foi concluido a instalçao do sistema de cloro gás na eta.\nPECAS:01 manifolde 4 pontos\n02 valvula redutora de pressão\n02 injetor 3/4\n02 dosador 50 kg/d\n01 detector de vazamento de cloro 02 flexivel 3 metros\n01 chave de operação\n02 abraçadeira yoke\n04 trunus para cilindros 900 kg\n07 curva soldavel pvc 40 mm\n02 bucha curta 50 x 40 mm\n02 tê soldavel pvc 40mm\n05 bucha de redução 40x32mm\n04 união pvc soldavem 32 mm\n04 luva l/r 32 x 1\"\n04 bucha de redução 1\" x 3/4\n01 joelho pvc 40mm\n04 abraçadeira D 1\"\n ALIMENTACAO: HOSPEDAGEM: ETC:', 2, '0000-00-00 00:00:00'),
(958, 1039, 'Encontramos o sistema de cloração com resíduos de sujeira nas válvulas e injetores .realizamos a limpeza e troca de Orings e válvulas e injetores ,molas de válvula de vácuo finalizado o sistema em perfeito a operação', 2, '0000-00-00 00:00:00'),
(959, 1040, 'Situação encontrada :o sistema de cloração estava fora de operação .motivo :bomba centrífuga danificada Realizado a troca de selo e rolamento da bomba centrífuga. finalizado com sucesso em operação', 2, '0000-00-00 00:00:00'),
(960, 1041, 'Situação encontrada :foi encontrado água em todo sistema de cloração .realizamos lavagem no manifold e secagem limpeza em todas as válvulas de manifold troca de molas e Origins de injetores troca de uma válvula de reguladora de pressão e vácuo e a troca de uma válvula de retenção  .finalizado com sistema operando normalmente', 2, '0000-00-00 00:00:00'),
(961, 998, 'OCORRENCIA: VACUO INSUFICIENTE\nCAUSA: ABERTURA DO SUSPIRO DO INJETOR\nSOLUCAO: LIMPEZA DO SUSPIRO\nPECAS: ALIMENTACAO: R$ 32,00\nHOSPEDAGEM:R$ 70,00 ETC:\n\nNO MOMENTO DA VISITA, A ETA ESTAVA OPERANDO NORMALMENTE.\n\nFEITO TESTES, NÃO IDENTIFICADO A CAUSA DA ABERTURA DO SUSPIRO.', 2, '0000-00-00 00:00:00'),
(962, 1028, 'OCORRENCIA: SEM DOSAR CORRETAMENTE\nCAUSA: ENTRADA DE AR\nSOLUCAO: RETIRADA DO AR\nPECAS: ALIMENTACAO: HOSPEDAGEM: ETC:\n\nLIMPEZA DO SISTEMA DE DOSAGEM, VOLTOU AO NORMAL. SONDA DANIFICADA/QUEBRADA.', 2, '0000-00-00 00:00:00'),
(963, 1045, 'OCORRENCIA: Vazamento de gás cloro.CAUSA: SOLUCAO: Ao chegar no local de atendimento, a princípio não pude identificar o local do vazamento. Pois não havia amônia por isso tive que me deslocar para poder  compra-la, foi então que consegui identificar que o vazamento era na entrada de cloro da reguladora de pressão. A mesma foi desmontada para que eu pudesse realizar a limpeza e manutenção e logo após o serviço o sistema foi liberado e seu funcionamento voltou ao normal.PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:', 2, '0000-00-00 00:00:00'),
(964, 905, 'OCORRENCIA: corretiva \nCAUSA: sistema vazando cloro gás \nSOLUCAO:  foi realizada a substituição do flexível, o mesmo estava danificado. Realizada a retirada de ar do sistema. Sistema funcionando normalmente.\n\n\n PECAS: Flexivel de 1,5 metros\n\n ALIMENTACAO: HOSPEDAGEM: ETC:', 2, '0000-00-00 00:00:00'),
(965, 941, 'OCORRENCIA: Corretiva \nCAUSA: Entupimento na linha de ácido\nSOLUCAO: Foi realizada a desobstrução da linha de ácido cloridico antes do reator. Ao término o gerador funciona normalmente.\n\n\n PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:', 2, '0000-00-00 00:00:00'),
(966, 1006, 'OCORRENCIA: Corretiva \nCAUSA: instalação de dosagem na pré cloração SOLUCAO: Foi realizada a instalação de um sistema de dosagem de dioxido de cloro na pré cloração. o sistema inclui reservatorio de 1000 litros, sensores de nível e bomba para dosagem; falta a caern levar a tubulação contendo dioxido até o reservatorio. \n\n\n\nPECAS: ALIMENTACAO: HOSPEDAGEM: ETC:', 2, '0000-00-00 00:00:00'),
(967, 994, 'OCORRENCIA: corretiva  \nCAUSA: sistema sem vácuo\nSOLUCAO: Foi realizada a substituição do diafragma e orings da reguladora de vácuo fluidfeeder, sistema de lajes; Feita substituição das mangueiras e limpeza do rotâmetro; sistema funcionando normalmente.\n\n\n PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:', 2, '0000-00-00 00:00:00'),
(968, 997, 'OCORRENCIA: corretiva \nCAUSA: vazamento de cloro gás \nSOLUCAO: Foi realizada inspeção nos injetores; Feita limpeza na reguladora de vácuo;  Substituição de mangueira; substituição de flexível;\n\n\n\nPECAS: ALIMENTACAO: HOSPEDAGEM: ETC:', 2, '0000-00-00 00:00:00'),
(969, 1037, 'OCORRENCIA: Corretiva \nCAUSA: Bomba com problemas \nSOLUCAO: Foi realizada a substituição da booster , a mesma estava com eixo partido; Ao término o sistema funciona normalmente.\n\n PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:', 2, '0000-00-00 00:00:00'),
(970, 1038, 'OCORRENCIA: Corretiva\nCAUSA: Vazamento de cloro gás\nSOLUCAO: Foi realizada a troca do oring do bico da reguladora; feita limpeza no rotametro; sistema funcionando normalmente.\n\n\n PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:', 2, '0000-00-00 00:00:00'),
(973, 1066, 'Encontramos o sistema operando parcialmente. Segundo operador da ETA havia queda de vácuo.\nRealizamos reparo nos oring\'s de injetores e limpeza no sistema de cloração.\nFinalizado com o sistema operando normalmente.', 2, '0000-00-00 00:00:00'),
(974, 1067, 'Sistema encontrado fora de operação.\nHaviam duas válvulas de 3/4 do sistema de cloração danificadas.\nRealizado a troca das válvulas e trocado oring\'s dos injetores.\nFinalizado com o sistema operando normalmente.', 2, '0000-00-00 00:00:00'),
(975, 1068, 'sistema de cloração operando normalmente.\nRealizamos manutenção preventiva com limpeza e pintura do equipamento de cloração.', 2, '0000-00-00 00:00:00'),
(976, 1069, 'Encontramos ETA funcionando parcialmente.\nHavia água no sistema de cloração.\nRealizamos manutenção de lavagem e secagem de monifold e válvulas.\nTrocamos oring\'s dos injetores e limpeza em todo o sistema.\nFinalizado com o sistema operando normalmente.', 2, '0000-00-00 00:00:00'),
(977, 1070, 'OCORRENCIA: corretiva CAUSA:plugue do injetor danificado (quebrado) SOLUCAO:realizada a substituição do plugue e feita a manutenção no injetor 3/4 e válvula reguladora, também feita a limpeza do Clorador de 240kg/dia e rotâmetro,e a troca  das mangueiras que se encontra ressecadaPECAS: ALIMENTACAO: HOSPEDAGEM: ETC:', 2, '0000-00-00 00:00:00'),
