(1020, 958, 'OCORRENCIA: preventiva.\nCAUSA: lipeza interno no tanque de pac 02.\n SOLUCAO: foi realizado limpeza interna no tanque de pac 02 o mesmo não apresentava resido de pac acumulado, foi fechado novamente e reabastecido. PECAS: ALIMENTACAO: 42,25\nHOSPEDAGEM: ETC:', 2, '0000-00-00 00:00:00'),
