(1022, 981, 'OCORRENCIA:operação acoplamento de cilindros.\n CAUSA: cilindros vazios.\n SOLUCAO: foi substituido, acoplado e testado com solução de amônia 02 cilindros, foi realizado limpeza nas válvulas redutora de pressão e trocado reparo da válvula reserva. PECAS: ALIMENTACAO:20,00\n HOSPEDAGEM: 60,00\nETC: combustivel 125,00', 2, '0000-00-00 00:00:00'),
