(1027, 928, 'OCORRENCIA: Nova Instalação. Nesta data foi realiza a montagem do sistema de cloração com válvulas reguladoras de pressão da clorando, injetores, rotametros e um conjunto motobomba da Schneider de 3cv. Ficando assim o sistema funcionado perfeitamente.: SOLUCAO: PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:', 2, '0000-00-00 00:00:00'),
