(3710, 3431, 'OCORRENCIA: corretiva \nCAUSA: vazamento de cloro gás \nSOLUCAO: foi realizada a substituição do flexivel, o mesmo estava danificado provocando vazamento;\nao termino o sistema fucniona normalmente.\n\n PECAS: flexivel de 1,5 metros\n\nALIMENTACAO: HOSPEDAGEM: ETC:', 19, '2019-06-07 11:05:55'),
(3711, 3507, 'OCORRENCIA:vazamento CAUSA: desgaste de peça SOLUCAO: troca do flexivel  PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:', 18, '2019-06-07 11:17:25'),
(3712, 3455, 'OCORRENCIA: corretiva \nCAUSA: bomba sem partida \nSOLUCAO: foi realizada a retirada da bomba e feito um novo ponto de dosagem, com autorização da CAERN;\nRealizada a substituição do diafragma do injetor siemens;\nAo término o sistema funciona normalmente.\n\n PECAS: diafragma injetor siemens 3/4\n\nALIMENTACAO: HOSPEDAGEM: ETC:', 19, '2019-06-07 14:08:06'),
(3713, 3524, 'OCORRENCIA: corretiva \nCAUSA: sistema apresentando obstrução \nSOLUCAO: Foi realizada limpeza na reguladora de vácuo, e troca do diafragma e conjunto de Orings;\nFeita limpeza na Valvula raio 0;\nFeita substituição do flexivel, o mesmo apresentava corrosão;\nao término o sistema funciona normalmente.\n\n PECAS: diafragma e orings da reguladora fluidfeeder, flexivel 3,5 metros\n\n ALIMENTACAO: HOSPEDAGEM: ETC:', 19, '2019-06-07 14:13:48'),
(3714, 3526, 'OCORRENCIA: preventiva\nCAUSA: relato de bomba sem funcionar \nSOLUCAO: Bomba funcionando normalmente;\nfoi realizada limpeza no rotametro;\nsistema funcionando normalmente.\n\n\n PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:', 19, '2019-06-07 14:17:37'),
(3715, 3526, 'OCORRENCIA: preventiva\nCAUSA: relato de bomba sem funcionar \nSOLUCAO: Bomba funcionando normalmente;\nfoi realizada limpeza no rotametro;\nsistema funcionando normalmente.\n\n\n PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:', 19, '2019-06-07 14:17:38'),
(3716, 3202, 'OCORRENCIA: corretiva \nCAUSA: sistema sem clorar\nSOLUCAO: foi realizada inspeção no sistema;\nfeita limpeza no rotametro. \nsistema funcionando normalmente.\n\n\n PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:', 19, '2019-06-07 14:21:47'),
(3717, 3260, 'OCORRENCIA: preventiva\nCAUSA: flexivel danificado \nSOLUCAO: Foi realizada a substituição do flexivel danififcado;\nfeita limpeza na reguladora de vácuo reserva;\nfeita correção no injetor reserva;\nao término o sistema funciona normalmente.\n\n PECAS: flexivel 1,5 metros;\n\n\nALIMENTACAO: HOSPEDAGEM: ETC:', 19, '2019-06-07 14:28:51'),
(3718, 3533, 'OCORRENCIA: corretiva\nCAUSA: vazamento de cloro gás \nSOLUCAO: foi realizada a substituição da valvula raio 0 com defeito;\nfeita a instalação das reguladoras novas fluidfeeder;\nfeita manutenção no injetor reserva de lajes;\nsistema funcionando normalmente.\n\n\n PECAS: valvula raio 0; duas reguladoras fluidfeeder.\n\n\nALIMENTACAO: HOSPEDAGEM: ETC:', 19, '2019-06-07 14:32:44'),
(3719, 3534, 'OCORRENCIA: NOVA INSTALAÇÃO\nCAUSA: SOLICITAÇÃO DO CLIENTE\nSOLUCAO: FOI REALIZADA A INSTALAÇÃO DE UM NOVO MANIFOLD;\nFOI REALIZADA A INSTALAÇÃO DE UMA NOVA REDUTORA DE PRESSÃO 3000PPD;\nNOVO SISTEMA COMPLETO INSTALADO E FUNCIONANDO NORMALMENTE;\nMANIFOLD COM 6 PONTOS, 2 MANOVACUOMETROS, 4 VALVULAS MGA, UNIÃO TIPO AMONIA;\nFEITA REALOCAÇÃO DO SISTEMA DA PRÉ-CLORAÇÃO.\n\n PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:', 19, '2019-06-07 14:46:09'),
(3720, 3532, 'OCORRENCIA: CAUSA: SOLUCAO: REALIZADO VISITA NA ETA PARA VERIFICAR UM POSSÍVEL VAZAMENRO PELO CILINDRO DE CLORO GÁS.  O CILINDRO HAVIA SISO TROCADO PELO SUP. ALAN E O OPERADOR DA ETA. CILINDRO( 582126) ESTÁ COM A VÁLVULA \" LOUCA\". COLOCADO CAP E CAPACETE. ', 29, '2019-06-08 09:21:00'),
(3721, 3538, 'OCORRENCIA: CAUSA: SOLUCAO: REALIZADO MANUTENÇÃO NA ETA COM A TROCA DE UM SELO MECÂNICO DA BOMBA CENTRIFUGA.  REALIZADO PREVENTIVA NOS CLORADORES.  SISTEMA FICOU OPERANDO NORMALMENTE. ', 29, '2019-06-08 09:28:47'),
(3722, 3542, 'OCORRENCIA: CAUSA: SOLUCAO: REALIZADO MANUTENÇÃO NA ETA COM OS SEGUINTES ITENS:\nFOI SUBSTITUÍDO UMA MANGUEIRA DE 32 MM DA ÁGUA VINDA DA CAPTAÇÃO DO POÇO VINDO DO RIO. A TUBULAÇÃO ANTIGA ESTAVA OBSTRUIDA COM RESÍDUO DE ÓXIDO DE FERRO. NOSSOS CLORADORES TAMBÉM ESTAVAM OBSTRUINDO COM ESSES MESMOS RESÍDUO.  FEITO LIMPEZA E TROCADO UM DOS CLORADORES.  SISTEMA FICOU OPERANDO NORMALMENTE. ', 29, '2019-06-08 09:36:36'),
(3723, 3545, 'OCORRENCIA: CAUSA: SOLUCAO: REALIZADO VISITA TÉCNICA NA ETA E VERIFICADO TODO O SISTEMA É NÃO FOI ENCONTRADO NENHUM PROBLEMA NOS CLORADORES. HAVIA SIDO FEITO UMA MUDANÇA NA TUBULAÇÃO PELA CAGECEE DESDE ESTÃO  O VISUAL DO CLORO NÃO ESTAVA BOM. FOI PEDIDO AO OPERADOR PARA AUMENTAR A VAZÃO  DO CLORO E ELES CONSEGUIRAM MELHORAR O VISUAL DO CLORO NAS ANÁLISES.  SISTEMA FICOU OPERANDO NORMALMENTE. ', 29, '2019-06-08 09:45:53'),
(3724, 3556, 'OCORRENCIA: CAUSA: SOLUCAO: REALIZADO MANUTENÇÃO NA ETA COM A TROCA DE UM DIAFRAGMA DE UMA VÁLVULA REGULADORA DE PRESSÃO. REALIZADO MANUTENÇÃO EM UMA DAS BOMBAS CENTRÍFUGAS.  SISTEMA FICOU OPERANDO NORMALMENTE. ', 29, '2019-06-08 09:53:01'),
(3725, 3562, 'OCORRENCIA: CAUSA: SOLUCAO: REALIZADO MANUTENÇÃO NA ETA COM REPARO NA BOTUEIRA DE UMA DAS BOMBAS CENTRÍFUGAS.  SISTEMA FICOU DESLIGADO POR MANUTENÇÃO INTERNA DA CAGECE.', 29, '2019-06-08 09:57:47'),
(3726, 3509, 'OCORRENCIA: instalcao dos novos equipamentos CAUSA: SOLUCAO: foi realizada a instalação dos cloradores de 500kg/dia ,feita a montagem do manifolde  e pintura ,feito todos os testes nao houve vazamento  nas conexões \n,porém  nao houve vacuo suficiente  para os injetores e tivemos que entrar novamente com o equipamento  da fluider fedeer  ,para manter o residual de cloro na rede ,o sistema ficou em operação  com o sistema antigo onde o mesmo também  sempre havendo queda de pressão  na rede,mas mantendo o residual \n PECAS: sistema de coloração  de 500hk/dia máscara Anatômica  detector de cloro \nKit \"B\" ,ALIMENTACAO: HOSPEDAGEM: ETC:', 8, '2019-06-08 10:07:58'),
(3727, 3295, 'OCORRENCIA: CAUSA: SOLUCAO: Instalação de umabomba de arrasto 3cv.com sua chave de partida.  PECAS: Uma bomba com suas tubulações e com suas pinturas, feito os testes no local sem nenhum vazamento ALIMENTACAO: HOSPEDAGEM: ETC:', 5, '2019-06-09 09:29:53');
